import { useParams, Route } from "react-router-dom";
import Comments from "./../components/comments/Comments";

const QuoteDetail = () => {
  const params = useParams();
  
  return (
    <div>
      <h2>Page 2</h2>
      <h2>{params.id}</h2>

      <Route path={`/quotes/${params.id}/comments`}>
        <Comments></Comments>
      </Route>
    </div>
  );
};

export default QuoteDetail;
